*
 * JS调用客户端，用于显示客户端调起第三方认证
 *
 * 支持平台：书旗Android、书旗iOS
 *
 * @return {Promise<void>}
 *
 * @example
 * const targetMap = {
 *   weixin: '2',
 *   zhifubao: '8',
 *   qq: '3',
 *   weibo: '1',
 *   taobao: '6',
 * };
 * const params = {
 *   target: targetMap.qq,
 * };
 * libSQ.exec('call-app-auth', { params }).catch((err) => {
 *  alert(`[call-app-auth][error] ${JSON.stringify(err, null, 2)}`);
 *   const e = err.detail.__$rawError__;
 *   alert(e.message);
 *   alert(e.stack);
 * });

